import "./HomePage.css";
import { Link } from "react-router-dom";
// import gif from "../images/space.gif";
import gif from "../images/start.gif";

function HomePage() {
  return (
    <div className="home-page">
      <div className="home-page-container">
        <h1 className="title">
          <span id="first-row">
            <span id="bingo-txt">빙고</span>로 알아보는
          </span>
          <br />
          <span>나의 </span>
          <span className="accent highlight">
            <span id="real-txt">진짜 </span>
            <span id="mbti-txt">MBTI</span>
            <span id="exc-mark">!</span>
          </span>
        </h1>
        <div className="heroheader">
          <img src={gif} alt="heroheader" width="100%" />
        </div>

        <Link to="/profile" className="btn">
          시작하기
        </Link>
      </div>
    </div>
  );
}

export default HomePage;
